// INTERPOLATION EXPLANATION
//
// FIRST OBTAIN CORNER VALUES FROM STORED ARRAY:
//   ld: left-down
//   lu: left-up
//   rd: right-down
//   ru: right-up
//
//   lu--------ru
//    |        |
//    |        |
//    |    x   |
//    |        |
//    |        |
//   lu--------ru
//
// THEN OBTAIN CROSS VALUES
//  (l): left  -> interpolated from ld and lu
//  (r): right -> interpolated from rd and ru
//  (u): up    -> interpolated from lu and ru
//  (d): down  -> interpolated from ld and rd
//
//    ----(u)---
//    |        |
//    |        |
//   (l)   x   (r)
//    |        |
//    |        |
//    ---(d)----
// 
// THEN FINAL RESULT IS INTERPOLATED FROM (l), (r), (u), (d)
//
// INTERPOLATION ALWAYS DONE VIA LINEAR-LOGARITHMIC FORMULA:
// y = y(-)^d(+) * y(+)^d(-)
// WHERE 
// y(-), y(+): neighbors
// AND
// d(-) = (x - x(-)) / (x(+) - x(-))
// d(+) = (x(+) - x) / (x(+) - x(-))
// AND
// x(+), x(-): bin edges before (-) and after (+) the requested value
//
// ***************************************************************************************
// ***************************************************************************************
