//The interpolator function
double xi_interpolator(double Phi0, double Q)
{
  //Checking if the arguments are within bounds
  if(Phi0>Phi0max || Phi0<Phi0min || Q>Qmax || Q<Qmin) 
  {
    cerr << "xi interpolator input values out of bounds (Q=" << Qmin << "..." << Qmax << ", Phi0=" << Phi0min << "..." << Phi0max << ")" << endl;
    return -9999;
  }
  
  //Calculating Phi0 bin number left and right from input Phi0 value
  int iPhi0_left = (int)floor((Phi0-Phi0min)/dPhi0);
  int iPhi0_rght = iPhi0_left+1;
  //If at maximum, right=left to avoid going out of bounds
  if(Phi0 == Phi0max) iPhi0_rght = iPhi0_left;  
  //DEBUG message
  if(_DEBUG) cerr << "iPhi0: " << iPhi0_left << ", " << iPhi0_rght << endl;
  
  //Calculating Phi0 values left and right from input Phi0
  double Phi0_left = xi_array[iPhi0_left][0][1];
  double Phi0_rght = xi_array[iPhi0_rght][0][1];
  //Calculating relative distance of left and right point as fraction of bin distance dPhi0
  double dPhi0rght = (Phi0_rght-Phi0)/dPhi0;
  double dPhi0left = (Phi0-Phi0_left)/dPhi0;
  //If at maximum, left relative distance is zero, but right relative distance should be one
  if(Phi0 == Phi0max) dPhi0rght = 1;
  //DEBUG message
  if(_DEBUG) cerr << "Phi0 left, right: " << Phi0_left << ", " << Phi0_rght << endl;
  
  //Calculating Q bin number up and down from input Q value
  int iQ_dn = (int)floor((Q-Qmin)/dQ);
  int iQ_up = iQ_dn+1;
  //If at maximum, up=down to avoid going out of bounds
  if(Q == Qmax) iQ_up = iQ_dn; 
  //DEBUG message
  if(_DEBUG) cerr << "iQ: " << iQ_dn << ", " << iQ_up << endl;
  
  //Calculating Q values up and down from input Q
  double Q_dn = xi_array[0][iQ_dn][0];
  double Q_up = xi_array[0][iQ_up][0];
  //Calculating relative distance of up and down point as fraction of bin distance dQ
  double dQup = (Q_up-Q)/dQ;
  double dQdn = (Q-Q_dn)/dQ;
  //If at maximum, up down distance is zero, but up relative distance should be one
  if(Q == Qmax) dQup = 1; 
  //DEBUG message
  if(_DEBUG) cerr << "Q dn, up: " << Q_dn << ", " << Q_up << endl;
  
  //Storing four corner values (left down, left up, right down, right up) from the xi_array table
  double xi_ld = xi_array[iPhi0_left][iQ_dn][2];
  double xi_lu = xi_array[iPhi0_left][iQ_up][2];
  double xi_rd = xi_array[iPhi0_rght][iQ_dn][2];
  double xi_ru = xi_array[iPhi0_rght][iQ_up][2];
  
  //DEBUG messages
  if(_DEBUG) cerr << "corners: (" << iPhi0_left << "," << iQ_dn << ") (" << iPhi0_left << "," << iQ_up << ") (" << iPhi0_rght << "," << iQ_dn << ") (" << iPhi0_rght << "," << iQ_up << ") " << endl;
  if(_DEBUG) cerr << "Phi weights: " << dPhi0left << "," << dPhi0rght << "\t; Q weights: \t" << dQdn << "," << dQup << endl; 
  if(_DEBUG) cerr << "corner values: " << xi_ld << ", " << xi_lu << ", " << xi_rd << ", " << xi_ru << endl;
  
  //Calculating four "cross values", up, down, left and right from the requested (Phi0,Q) values, interpolating from the "corner values"
  double xi_l = (pow(xi_ld,dQup)*
                 pow(xi_lu,dQdn));
  double xi_r = (pow(xi_rd,dQup)*
                 pow(xi_ru,dQdn));
  double xi_d = (pow(xi_ld,dPhi0rght)*
                 pow(xi_rd,dPhi0left));
  double xi_u = (pow(xi_lu,dPhi0rght)* 
                 pow(xi_ru,dPhi0left));
             
  //DEBUG message    
  if(_DEBUG) cerr << "cross values: " << xi_l << ", " << xi_r << ", " << xi_d << ", " << xi_u << endl;

  //Calculating xi value at desired (Phi0,Q), interpolated from the "cross values"
  double xi = (pow(xi_l,dPhi0rght/2.)*
               pow(xi_r,dPhi0left/2.)*
               pow(xi_d,dQup/2.)*
               pow(xi_u,dQdn/2.));
        
  //DEBUG message       
  if(_DEBUG) cerr << "result = " << xi << endl;
  
  //Returning calculated xi value
  return xi;
}